    [],nt"num_tags": 4,nt"name": "necedah-national-wildlife-refuge-narrative-report-may-1-to-august-31-1942",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from May through August of 1942. The report begins by summarizing
    the weather conditions, water conditions, and food and cover during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments and plantings. Resource management is outlined;
    topics include grazing and timber removal. The public relations section of the report
    describes recreational uses, Refuge visitors, fishing, and violations. Items of
    interest and N-R forms are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
